pragma solidity 0.8.18;

import "hardhat/console.sol";

contract PollingContract {
    struct Poll {
        uint id;
        string topic;
        string[] options;
        uint256[] votes;
        address[] voters;
        uint256 timestamp;
    }

    uint256 public _pollId;

    mapping(uint => Poll) public polls;

    function CreatePoll(string memory _topic, string[] memory _options)
        public
        returns (Poll memory)
    {
        require(
            bytes(_topic).length > 0 && _options.length > 0,
            "Incomplete parameters"
        );
        ++_pollId;
        address[] memory voters;
        polls[_pollId] = Poll({
            id: _pollId,
            topic: _topic,
            timestamp: block.timestamp,
            options: _options,
            votes: new uint256[](_options.length),
            voters: voters
        });
        return polls[_pollId];
    }

    function getPoll(uint256 pollId) public view returns (Poll memory poll) {
        return polls[pollId];
    }

    function vote(uint256 pollId, uint256 optionIndex)
        public
        returns (uint256)
    {
        require(!hasVoted(pollId), "You have voted already");
        polls[pollId].votes[optionIndex] += 1;
        polls[pollId].voters.push(msg.sender);
        return polls[pollId].votes[optionIndex];
    }

    function hasVoted(uint256 pollId) public view returns (bool) {
        if (polls[pollId].voters.length == 0) {
            return false;
        }
        for (uint i = 0; i <= _pollId; i++) {
            if (msg.sender == polls[pollId].voters[i]) {
                return true;
            }
        }
        return false;
    }
}

